    true,nt"url": null,nt"notes": "The System Advisor Model (SAM) is a performance
    and financial model designed to facilitate decision making for people involved in
    the renewable energy industry. SAM makes performance predictions and cost of energy
    estimates for grid-connected power projects based on installation and operating
    costs and system design parameters that you specify as inputs to the model. Projects
    can be either on the customer side of the utility meter, buying and selling electricity
    at retail rates, or on the utility side of the meter, selling electricity at a price
    negotiated through a power purchase agreement (PPA).",nt"license_title": "Creative
